import data from './data';

function App() {
  return (
    <div>
      <header>
        <a href="/">amazona</a>
      </header>
      <main>
        <h1>Featured Products</h1>
        {data.products.map((product) => (
          <div key={product.slug}>
            <img src={product.image} alt={product.image} />
            <p>
              {product.name}
              {product.price}
            </p>
          </div>
        ))}
      </main>
    </div>
  );
}

export default App;
